import React from 'react';
import { navStyle } from '../navStyle';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';
//import ButtonToolbar from 'react-bootstrap/ButtonToolbar';

class Navigation extends React.Component {
  constructor (props) {
    super(props);
    this.colorChange = this.colorChange.bind(this);
    this.state = {onHover: null};
  }



  componentDidMount () {
     console.log('component did mount')
  }

  render() {

    let { color, backgroundColor, brand, justifyContent } = navStyle;
    let colorChange = (e) => {
      console.log('hi');
    };

    return (
        <Navbar style={{backgroundColor, justifyContent}} expand="lg">
            <Navbar.Brand style={brand} href="#home" className="">Personal Capital</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav" className="justify-content-end">
              <Nav fill variant="pills">
                <Nav.Item>
                  <Nav.Link style={{color}} href="/home">Financial Tools</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link style={{color}}>Wealth Management</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link style={{color}}>About</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Nav.Link style={{color}}>Resources</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                  <Button variant='outline-warning' onHover={(e) => this.colorChange} style={{marginLeft: '1em', marginRight: '1em', border: '2px solid #FD9D2E', backgroundColor: ''}}>Login</Button>
                </Nav.Item>
                <Nav.Item>
                  <Button style={{marginLeft: '1em', marginRight: '1em'}}>Sign Up</Button>
                </Nav.Item>
              </Nav>
            </Navbar.Collapse>
        </Navbar>
    )
  }
}

export default Navigation;
